import React from 'react';
import NikeAir from '../../img/Nike-Air.png'
import NikeAirMax from '../../img/Nike-air-max.png'
import NikeAntiClog from '../../img/Nike-Anti-Clog.png'
import NikeFlyease from '../../img/Nike-Flyease.png'
import NikeFlyknit from '../../img/Nike-Flyknit.png'
import NikeKD14 from '../../img/tenis-nike-kd14.png'
import DeleteIcon from '@material-ui/icons/Delete';
import Button from '@material-ui/core/Button';
import BorderColorIcon from '@material-ui/icons/BorderColor';
import Header from '../Header';
import { Link } from "react-router-dom";
import './Main.css';


export default function Main (){

  const calcados = [
    {
      id:1,
      nome:"Nike Air",
      imagemUrl: NikeAir,
      modelo:'Masculino',
      preco:499
    },
    {
      id:2,
      nome:"Nike Air Max",
      imagemUrl:NikeAirMax,
      modelo:'Feminino',
      preco:450
    },
    {
      id:3,
      nome:"Nike Anti-Clog",
      imagemUrl:NikeAntiClog,
      modelo:'Infantil',
      preco:400
    },
    {
      id:4,
      nome:"Nike Flyease",
      imagemUrl:NikeFlyease,
      preco:430
    },
    { 
      id:5,
      nome:"Nike Flyknit",
      imagemUrl:NikeFlyknit,
      preco: 350
    },
    { 
      id:6,
      nome:"Nike KD14",
      imagemUrl:NikeKD14,
      preco:380
    }  

  ]

  return(

    <div className="container">
      <Header />
      <main className="main">
        <ul>
          {calcados.map((calcado,index)=>(
            <li key = {index}>
              <div className="imagem">
                <img src={calcado.imagemUrl} className={calcado.class} alt={calcado.nome}/>
                <div className='botoes'>
                <Button variant="contained" color="primary">
                  Comprar
                </Button>
                <div className="acoes">
                  <Link to="/cadastro" className="btn"> <button className='botaoIcon'><BorderColorIcon className='icon' id='edit' /></button> </Link>
                  <button className='botaoIcon' ><DeleteIcon className='icon' id='delete' /></button>
                </div>
                </div>
              </div>
              <div className='info'>
              <h3>{calcado.nome}</h3>
              </div>
            </li>


          ))}
        </ul>
      </main>
    </div>
  );
}
